import React from 'react';

const ColoredBox = ({ width, height, backgroundColor }) => {
  const boxStyle = {
    width,
    height,
    backgroundColor,
  };

  return <div className="colored-box" style={boxStyle}></div>;
};

export default ColoredBox;
